ir, ReportDir, ResultDir, NormalizedDir, LabeledDir, ThresholdDir]]\n    os.environ['DARSHAN_LOG_DIR_PATH'] = ReportDir \n\n    filename_pattern = os.path.join(\"Dataset/images\", '*.png')\n    client, dask_perf_report, task_graph, task_stream = validate(mode, yappi_config, dask_perf_report, \n                                                                task_graph, task_stream, scheduler_file)\n    # Main workflow \n    with (\n        performance_report(filename=ReportDir+dask_perf_report) as dask_perf,\n        yappi.run(),\n    ):\n\n        images = dask_image.imread.imread(filename_pattern)[:10]\n        print(images)\n        try:\n            normalized_images = (images - da.min(images)) * (255.0 / (da.max(images) - da.min(images)))\n            print(normalized_images)\n            normalized_images.map_blocks(save_file, NormalizedDir, \"normalized-\" , dtype=normalized_images.dtype, enforce_ndim=False).compute()\n        except Exception as e:\n            print(\"There was an excp \", e )\n\n        print(\"Normalized  images: \", normalized_images) \n\n        results = [processing(im) for im in normalized_images]\n        label_images = [r[\"label_image\"] for r in results]\n        threshold_image = [r[\"threshold_image\"] for r in results]\n\n        label_images = da.stack(label_images)\n        threshold_image = da.stack(threshold_image)\n\n        try:\n            label_images.map_blocks(save_file, LabeledDir, \"labeled-\", dtype=label_images.dtype, enforce_ndim=False).compute()\n        except Exception as e:\n            print(\"There was an excp \", e )\n\n        try:\n            threshold_image.map_blocks(save_file, ThresholdDir, \"threshold-\", dtype=threshold_image.dtype, enforce_ndim=False).compute()\n        except Exception as e:\n            print(\"There was an excp \", e )\n\n    # Output Reports for yappi\n    yappi.get_func_stats().save(ReportDir+\"yappi.pstat\", type=\"ystat\")\n    with open(ReportDir + \"yappi.debug.yaml\", 'w') as f:\n        sys.stdout = f\n        yaml.dump(yappi.get_func_stats().debug_print())\n        sys.stdout = stdout\n\n    # Output task stream\n    with open(ReportDir + task_stream, 'w') as f:\n        yaml.dump(client.get_task_stream(), f)\n \n\n    # Output dask distributed Configuration \n    with open(ReportDir + \"distributed.yaml\", 'w') as f:\n        yaml.dump(dask.config.get(\"distributed\"),f)\n\n\n\n    client.shutdown()\n\n        &lt;/pre&gt;\n        "}}}},{"type":"object","name":"TabPanel","id":"p1475","attributes":{"title":"Task Stream","child":{"type":"object","name":"Figure","id":"p1123","attributes":{"name":"task_stream","sizing_mode":"stretch_both","x_range":{"type":"object","name":"DataRange1d","id":"p1121","attributes":{"range_padding":0}},"y_range":{"type":"object","name":"DataRange1d","id":"p1122","attributes":{"range_padding":0}},"x_scale":{"type":"object","name":"LinearScale","id":"p1133"},"y_scale":{"type":"object","name":"LinearScale","id":"p1134"},"title":{"type":"object","name":"Title","id":"p1126","attributes":{"text":"Task Stream"}},"renderers":[{"type":"object","name":"GlyphRenderer","id":"p1163","attributes":{"data_source":{"type":"object","name":"ColumnDataSource","id":"p1118","attributes":{"selected":{"type":"object","name":"Selection","id":"p1119","attributes":{"indices":[],"line_indices":[]}},"selection_policy":{"type":"object","name":"UnionRenderers","id":"p1120"},"data":{"type":"map","entries":[["start",[1705518433467.27,1705518433468.1997,1705518433469.1768,1705518433469.9412,1705518433470.7446,1705518433471.3965,1705518433472.2827,1705518433473.6118,1705518433474.2483,1705518433474.964,1705518433475.9812,1705518433476.8032,1705518433485.4792,1705518433485.7612,1705518433485.94,1705518433486.2705,1705518433486.372,1705518433486.6125,1705518433486.701,1705518433486.936,1705518433487.022,1705518433487.257,1705518433487.5273,1705518433494.614,1705518433503.3015,1705518433503.6487,1705518433503.9436,1705518433504.223,1705518
